import React from 'react';
import {LineStage, Steps, Step} from './styles';

function StageComponent() { 
  return (
    <>
      <LineStage />
      <Steps>
        <Step>Cart</Step>
        <Step>Payment options</Step>
        <Step>Receipt</Step>
      </Steps>
    </>
  );
}
export default StageComponent;
